import React from "react";
import { Grid, Image } from 'semantic-ui-react'


function Api() {
  return (
    <>
      <Grid>
        <Grid.Column width={4}>
          <Image src="/images/wireframe/image.png" />
        </Grid.Column>
        <Grid.Column width={9}>
          <Image src="/images/wireframe/paragraph.png" />
        </Grid.Column>
        <Grid.Column width={3}>
          <Image src="/images/wireframe/media-paragraph.png" />
        </Grid.Column>
      </Grid>
    </>
  );
}

export default Api;
